import React from "react";
import CardsFetch from "./components/CardsFetch";
import Card from "./components/Card";

class List extends React.Component{
    constructor(){
        super();
        this.state={
            items:[]
        }
    }
    async componentWillMount(){
        this.fetchItems();
    }
    async fetchItems(){
        const data= await fetch('https://dog.ceo/api/breed/husky/images/random/6');
        const items=data.json();
        if(items.status==="success"){
            this.setState({items:items.message})
        }
    }


    render(){
        i=0;
        const cards=this.state.items.map(item=>{
            return <Card key={i++} imgUrl={item}/>
        });
        return(
            <div id="cards" className="row">
                {cards}
            </div>);
        }
}
export default List;
